import React from "react";
import "./Slotstable.css";

export default function CourtSchedule (){
  const data = [
    {
      time: "4 AM",
      courts: [
        { name: "Abbas", type: "checked-in" },
        { name: "Vinay Hasya...", type: "checked-in" },
        { name: "", type: null },
        { name: "", type: null },
        { name: "", type: null },
        { name: "", type: null },
      ],
    },
    {
      time: "5 AM",
      courts: [
        { name: "Shantanu", type: "checked-in" },
        { name: "Kailash", type: "payment", items: "6 Items", price: "₹300" },
        { name: "Venkatesh", type: "collect", items: "6 Items" },
        { name: "", type: "blocked" },
        { name: "", type: "blocked" },
        { name: "Blocked", type: "blocked" },
      ],
    },
    {
      time: "8 AM",
      courts: [
        { name: "", type: null },
        { name: "", type: null },
        { name: "Coaching", type: "coaching", count: "4/6", coach: "Sourav Kumar" },
        { name: "Coaching", type: "coaching", count: "4/6", coach: "Puja Minz" },
        { name: "Coaching", type: "coaching", count: "4/6", coach: "Sourav Kumar" },
        { name: "Coaching", type: "coaching", count: "4/6", coach: "Puja Minz" },
      ],
    },
    {
      time: "10 AM",
      courts: [
        { name: "Indrajeet", type: "completed" },
        { name: "Indrajeet", type: "completed" },
        { name: "", type: null },
        { name: "", type: null },
        { name: "", type: null },
        { name: "", type: null },
      ],
    },
  ];

  return (
    <div className="court-schedule">
      <div className="header">
        <div className="header-item">Time</div>
        {["Court 1", "Court 2", "Court 3", "Court 4", "Court 5", "Court 6"].map((court, index) => (
          <div className="header-item" key={index}>{court}</div>
        ))}
      </div>
      <div className="body">
        {data.map((row, rowIndex) => (
          <div className="row" key={rowIndex}>
            <div className="time">{row.time}</div>
            {row.courts.map((court, courtIndex) => (
              <div
                className={`court-cell ${court.type || ""}`}
                key={courtIndex}
              >
                {court.name && <p className="name">{court.name}</p>}
                {court.items && <p className="items">{court.items}</p>}
                {court.price && <p className="price">{court.price}</p>}
                {court.count && <p className="count">{court.count}</p>}
                {court.coach && <p className="coach">{court.coach}</p>}
              </div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
};
